import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';  // Adjust the path if needed

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: '#ffa24d', padding: '1rem' }}>
      <Link to="/" style={{ textDecoration: 'none', display: 'flex', alignItems: 'center' }}>
        <img src={logo} alt="oppey logo" style={{ height: '40px', marginRight: '1rem' }} />
        {/* Optionally, you can include text next to the image */}
      </Link>
      <Link to="/login/customer" style={{ color: '#fff', marginRight: '1rem', textDecoration: 'none' }}>
        Login as Customer
      </Link>
      <Link to="/login/vendor" style={{ color: '#fff', marginRight: '1rem', textDecoration: 'none' }}>
        Login as Vendor
      </Link>
      <Link to="/register/store" style={{ color: '#fff', textDecoration: 'none' }}>
        Register as Store
      </Link>
    </nav>
  );
};

export default Navbar;
